【用途】<br>替刃式折込鋸。<br><br>【機能・特徴】<br>竹の伐採作業用です。<br>折込タイプで収納持ち運びに便利。<br>経済的な替刃式。<br>切れ味・耐久性を両立した高硬度特殊鋼刃。<br><br>【材質】<br>●刃部：刃物鋼。<br>●柄部：樹脂。<br><br>【商品サイズ】奥行440×幅40×高さ20mm　重量262g<br><br>【注意事項・その他】<br>本来の用途以外には使用しないで下さい。使用前には本体あるいは部品にがたつき・緩みが無いことを確認してください。使用の際には保護めがね・手袋などを着用してください。使用後は汚れを取り、子供の手の届かない安全な場所に保管してください。<br><br><style type="text/css">
